export default function App() {
 const {fetchBlogPosts} = useContext(AppContext);
 useEffect(() => {
  fetchBlogPosts();
  }, []);
  
  return (
    <div>
      <Header />
      <Blogs />
      <Pagination />
    </div>
  );
}
